import styled from "styled-components";
import { GlobalStyles } from "./Styles/GlobalStyles";

// Componente Estilizado
const Title = styled.h1`
  font-size: 2rem;
  color: blue;

  p {
    font-size: 1rem;
    color: red;
  }
`;

function App() {
  return (
    <>
      <Title>Styled Components</Title>
      <GlobalStyles />
    </>
  );
}

export default App;
